import styled from "styled-components";

export const Paragraph = styled.li`
    margin-bottom: 10px;
    text-align: center;
    list-style: none;
    font-size: 15px;
    display: flex;
    justify-content: center;
    line-height: 1.5;
`;

export const List = styled.ul`
    list-style: none;
    padding: 50px;

    .subtitle{
        color: rgb(8, 165, 238);
    }

`;
